                        <html><head><meta charset="utf-8"></head><body>
<p>Кормовая добавка без минералов в виде прессованного солевого блока (лизунца) без минеральных солей, которая:</p>
<p>- Восполняет дефицит соли в организме животных;<br />- нормализует обмен веществ;<br />- стимулирует пищеварение и улучшает усвояемость кормов.</p>
<h5>Условия хранения:</h5>
<p>Хранить продукт в сухом и прохладном помещении, при температуре не выше 25&deg;С и влажности не более 75%. Срок годности при соблюдении условий хранения составляет 5 лет с даты изготовления продукта.</p>
</body></html>

                    </div>
                
            
                


                

                    <div class="tab-pane  "  id = "tab3">


                        <html><head><meta charset="utf-8"></head><body>
<p>Соль (хлорид натрия) высокой очистки.</p>
</body></html>
                    </div>

                
            
                


                

                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<h5>Дозировка и способ применения:</h5>
<p>Солевой блок (лизунец) размещается в удобном месте, обеспечивающим свободный доступ для животных. Точного дозирования не требуется. Среднесуточное потребление зависит от индивидуальных потребностей организма. Постепенное, равномерное и регулярное поступление компонентов смеси в организм животного способствует наиболее полному усвоению питательных веществ корма. Эффективно работает в любое время года. Обязательно необходимо обеспечить постоянный доступ животных к воде.</p>
<h5>Особые указания:</h5>
<p>При использовании продукта, исключить из рациона соль.</p>
<h5>Побочные действия:</h5>
<p>Данный продукт изготовлен из натуральных природных компонентов. Не содержит антибиотики, гормональные препараты и ГМО. Побочных явлений и осложнений при применении продукта выявлено не было, противопоказаний не установлено. После применения продукта мясо и молоко животных используется без ограничений.</p>
</body></html>
